import React from 'react';

const ProductList = ({ products }) => {
	if (Recipes.length > 0) {
		return <ul>{Recipes.map((products) => <li key={products}>{products}</li>)}</ul>;
	}

	return <p>No results!</p>;
};

export default ProductList;
